import 'bootstrap/dist/css/bootstrap.min.css';
import Header from "./components/Header";
import Title from './components/Title';
import Footer from './components/Footer';
function App() {
  return (
    <div className="App">
      <Header/>
      <Title style={{color: '#000'}}/>
      <Footer/>
    </div>
  );
}

export default App;
